import React, { Component } from 'react';

class Dice extends Component {
  constructor(props) {
    super(props);

    console.log(props.info.num);
    console.log(props.info.num2);
  }

  render() {
    return (
      <div>
        <i className={`fas fa-dice-${this.props.info.num}`}></i>
        <i className={`fas fa-dice-${this.props.info.num2}`}></i>
        <br></br>
        <br></br>
        <button>Roll Dice</button>
      </div>
    );
  }
}

export default Dice;
